description:
Embark on the exciting adventure in the sequel of famous series of Time Management games under the title Royal Enjoy 3: Campaign for the Crown. You are the only hope of the King of the magic kingdom. The King relies on you because you are the talented city planner and you are able to correct all the mistakes of the former rulers. You will face with many new challenges and meet numerous hilarious personalities in the gripping and stimulating Time Management game Royal Envoy 3: Campaign for the Crown.
